import React from "react";

const FooterLogo = () => {
    return (
        <svg width="14" height="22" viewBox="0 0 14 22" fill="none" xmlns="http://www.w3.org/2000/svg">
        <rect x="0.5" y="0.5" width="13" height="21" rx="6.5" stroke="black" stroke-opacity="0.5"/>
        <rect x="6" y="9" width="2" height="4" rx="1" fill="black" fill-opacity="0.5"/>
        </svg>
    );
};

export { FooterLogo };
